import React, { useState } from "react";
import Schedule from "./components/Schedule";
import { TeachersProvider } from "./context/TeachersContext";
import "./App.css";

// const teachers = [
//   { name: "Miles", teachingMins: 75 },
//   { name: "Tim", teachingMins: -40 },
//   { name: "Martin", teachingMins: 120 }
// ];

function App() {
  const [teachers, setTeachers] = useState([
    { name: "Miles", teachingMins: 75, resourceId: 0 },
    { name: "Tim", teachingMins: -40, resourceId: 1 },
    { name: "Bradley", teachingMins: 120, resourceId: 2 },
    { name: "Milton", teachingMins: 120, resourceId: 3 },
    { name: "Sarah", teachingMins: 120, resourceId: 4 }
  ]);
  return (
    <div className="App">
      <TeachersProvider value={{ teachers, setTeachers }}>
        <Schedule />
      </TeachersProvider>
    </div>
  );
}

export default App;
